import React, { useState } from "react"
import {Link} from "react-router-dom";

const UploadPage = ({ secretKey }) => {
    const [title, setTitle] = useState("")
    const [description, setDescription] = useState("")
    const [image, setImage] = useState(null)
    const [loading, setLoading] = useState(false)
    const [error, setError] = useState(null)
    const [success, setSuccess] = useState(false)

    const handleImageChange = (e) => {
        setImage(e.target.files[0])
    };

    const handleSubmit = async (e) => {
        e.preventDefault()

        if (!title || !description || !image) {
            setError("All fields are required.")
            return
        }
        setError(null)

        const formData = new FormData()
        formData.append("secretKey", secretKey)
        formData.append("title", title)
        formData.append("description", description)
        formData.append("image", image)

        setLoading(true)

        try {
            const response = await fetch("http://167.99.138.67:1111/createpost", {
                method: "POST",
                body: formData,
            });

            const result = await response.json()
            setLoading(false)

            if (result.success) {
                setSuccess(true)
                setTitle("")
                setDescription("")
                setImage(null)
            } else {
                setError(result.message || "An error occurred.")
            }
        } catch (err) {
            setLoading(false)
            setError("An unexpected error occurred.")
        }
    }

    return (
        <div>
            <div className="toolbar-container">
                <Link to="/gallery" className="text-white">HOME</Link>
                <Link to="/profile" className="text-white">Users</Link>
            </div>
            <div style={styles.body1}>
                <div style={styles.container}>
                    <h2 style={styles.h2}>Create Post</h2>
                    <form onSubmit={handleSubmit}>
                        <div style={styles.inputGroup}>
                            <label htmlFor="title">Title:</label>
                            <input
                                type="text"
                                id="title"
                                value={title}
                                onChange={(e) => setTitle(e.target.value)}
                                required
                                style={styles.input}
                            />
                        </div>

                        <div style={styles.inputGroup}>
                            <label htmlFor="description">Description:</label>
                            <textarea
                                id="description"
                                value={description}
                                onChange={(e) => setDescription(e.target.value)}
                                required
                                style={styles.input}
                            />
                        </div>

                        <div style={styles.inputGroup}>
                            <label htmlFor="image">Upload Image:</label>
                            <input
                                type="file"
                                id="image"
                                accept="image/*"
                                onChange={handleImageChange}
                                required
                                style={styles.input}
                            />
                        </div>

                        {error && <div style={styles.error}>{error}</div>}
                        {success && <div style={styles.success}>Post created successfully!</div>}

                        <button type="submit" disabled={loading} style={styles.button}>
                            {loading ? "Uploading..." : "Create Post"}
                        </button>
                    </form>
                </div>
            </div>
        </div>
    );
};

// Styles object in the same file
const styles = {
    body1: {
        display: "flex",
        justifyContent: "center",
        alignItems: "center",
        height: "100vh",
        margin: 0,
        padding: 0,
    },
    container: {
        backgroundColor: "white",
        padding: "20px",
        borderRadius: "8px",
        boxShadow: "0 4px 10px rgba(0, 0, 0, 0.1)",
        width: "100%",
        maxWidth: "400px", // Form will be centered with a maximum width
        textAlign: "center",
    },
    h2: {
        fontSize: "24px",
        marginBottom: "20px",
        color: "#333",
    },
    inputGroup: {
        marginBottom: "15px",
    },
    input: {
        width: "100%",
        padding: "10px",
        margin: "10px 0 20px 0",
        border: "1px solid #ccc",
        borderRadius: "4px",
        fontSize: "16px",
    },
    button: {
        backgroundColor: "#007bff",
        color: "white",
        padding: "12px 20px",
        border: "none",
        borderRadius: "4px",
        fontSize: "16px",
        cursor: "pointer",
        width: "100%",
    },
    error: {
        color: "red",
        marginTop: "10px",
    },
    success: {
        color: "green",
        marginTop: "10px",
    },
};

export default UploadPage;
